@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:BankComputer a owl:Class .
atm:CashCard a owl:Class .
atm:PasswordVerificationRequest a owl:Class .

atm:sendsRequest a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:PasswordVerificationRequest .

atm:checksPassword a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:PasswordVerificationRequest .

atm:validFor a owl:ObjectProperty ;
  rdfs:domain atm:PasswordVerificationRequest ;
  rdfs:range atm:CashCard .

atm:validCard a owl:DatatypeProperty ;
  rdfs:domain atm:CashCard ;
  rdfs:range xsd:boolean .
